import styled from "styled-components";
import { TRoom } from "../../types/chat"; 

const ExPersonalChatWrapper = styled.div`
  width:100%;
  height:100%;
  display:flex;
  flex-flow: row wrap;
`;

const PersonalList = styled.div`
  width: 100%;

`; 

const PChatItemWrapper = styled.div`
  width: 100%;
  padding: 15px;
`; 


interface Props { 

}


interface PCItemProps { 
  readonly item: TRoom; 
}

const personals: TRoom[] = [ 
  {
    id: 0,
    roomKey: 'roombot1',
    roomName: '챗봇01',
    lastMsg: '반갑습니다 ^^',
    lastDatetime: '',
    seen: false,
    profile:'https://images.mypetlife.co.kr/content/uploads/2019/09/04222847/dog-panting-1024x683.jpg'
  },
  {
    id: 0,
    roomKey: 'roombot2',
    roomName: '챗봇02',
    lastMsg: '반갑습니다 ^^',
    lastDatetime: '',
    seen: false,
    profile:'https://images.mypetlife.co.kr/content/uploads/2019/09/04222847/dog-panting-1024x683.jpg'
  },
  {
    id: 0,
    roomKey: 'roombot3',
    roomName: '챗봇03', 
    lastMsg: '반갑습니다 ^^',
    lastDatetime: '',
    seen: false,
    profile:'https://images.mypetlife.co.kr/content/uploads/2019/09/04222847/dog-panting-1024x683.jpg'
  }

];

const ExPersonalChat = ({  }:Props):JSX.Element=> {

  return (
    <ExPersonalChatWrapper> 
      {personals.length === 0 && <p>No Data</p>}   
      <PersonalList>
          {personals.map((item: TRoom) => (
            <PersonalChatItem item={item}/>
          ))}  
      </PersonalList>
    </ExPersonalChatWrapper> 
  )

}



const PersonalChatItem = ({ item }: PCItemProps): JSX.Element => {   
  return (
    <PChatItemWrapper>
      <div className="avatar">
        <img src={item.profile}  alt='avatar'/>
      </div>
      <div className="">
        <div className="room_name"></div>
        <div className="room_name"></div>
      </div>
      {item.roomName}
      {item.lastMsg} 
    </PChatItemWrapper>
  );
}


export default ExPersonalChat;
